import React, { useEffect } from 'react';
import { useHistory } from 'react-router-dom';

const authenticated = Component => props => {
    const history = useHistory();

    useEffect(() => {
        const token = localStorage.getItem('token');
        if (!token) {
            history.push('/login');
        }
    }, [history]);

    return <Component {...props} />
}
